import './App.css';
import Video from './pages/Video';

function App() {
  return (
    <div className="App">
    <div className='app__videos'>
      <Video
      likrs={100}
      messagens={200} 
      shares={300}
      name="eumesmo"
      descriptions="bom de bola"
      music="musica epica"
      />
      <Video
      likrs={130}
      messagens={230} 
      shares={330}
      name="eumesmo"
      descriptions="bom de bola"
      music="musica epica"
      />
      <Video
      likrs={103}
      messagens={203} 
      shares={303}
      name="ppgradao"
      descriptions=""
      music="musica epica"
      />
      
    </div>
    </div>
  );
}

export default App;
